  "inlineSchema": "// prisma/schema.prisma\n\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../src/generated/client\"\n}\n\n// INI BAGIAN YANG WAJIB ADA\ndatasource db {\n  provider = \"mysql\"\n  url      = env(\"DATABASE_URL\")\n}\n\nmodel Session {\n  pkId      Int      @id @default(autoincrement())\n  sessionId String\n  id        String\n  data      String   @db.LongText\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([sessionId, id], map: \"unique_session_id_key\")\n  @@index([sessionId])\n}\n\nmodel User {\n  id               Int       @id @default(autoincrement())\n  email            String    @unique\n  password         String\n  waSessionId      String    @unique // ID Tim/Sesi WA (ex: cs_pagi)\n  role             String    @default(\"USER\") // USER atau DEVELOPER\n  expiryDate       DateTime? // null = unlimited (untuk developer)\n  hideCountdown    Boolean   @default(false) // preference untuk menyembunyikan countdown\n  resetToken       String?\n  resetTokenExpiry DateTime?\n  createdAt        DateTime  @default(now())\n}\n\nmodel Chat {\n  id            Int       @id @default(autoincrement())\n  sessionId     String\n  remoteJid     String\n  name          String?\n  label         String    @default(\"General\")\n  note          String?   @db.Text\n  profilePicUrl String?   @db.Text\n  messages      Message[]\n  createdAt     DateTime  @default(now())\n  updatedAt     DateTime  @updatedAt\n\n  @@unique([sessionId, remoteJid])\n  @@index([sessionId])\n}\n\nmodel Message {\n  id        Int      @id @default(autoincrement())\n  chatId    Int\n  chat      Chat     @relation(fields: [chatId], references: [id], onDelete: Cascade)\n  keyId     String?\n  fromMe    Boolean\n  text      String?  @db.LongText\n  mediaUrl  String?\n  createdAt DateTime @default(now())\n}\n\nmodel Sale {\n  id           Int      @id @default(autoincrement())\n  sessionId    String\n  itemName     String\n  qty          Int\n  price        Float\n  customerJid  String?\n  customerName String?\n  date         DateTime @default(now())\n\n  @@index([sessionId])\n}\n\nmodel Schedule {\n  id          Int      @id @default(autoincrement())\n  sessionId   String\n  title       String\n  description String?  @db.Text\n  date        DateTime\n  customerJid String?\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  @@index([sessionId])\n}\n\n// Email Verification Codes\nmodel VerificationCode {\n  id        Int      @id @default(autoincrement())\n  email     String\n  code      String\n  type      String // \"REGISTER\" or \"RESET_PASSWORD\"\n  expiresAt DateTime\n  verified  Boolean  @default(false)\n  createdAt DateTime @default(now())\n\n  @@index([email, type])\n}\n\n// Scheduled Broadcasts\nmodel ScheduledBroadcast {\n  id            Int       @id @default(autoincrement())\n  sessionId     String\n  title         String\n  message       String    @db.Text\n  targetLabel   String    @default(\"all\") // \"all\" or specific CRM label\n  manualNumbers String?   @db.Text // comma-separated numbers for manual target\n  scheduledAt   DateTime\n  status        String    @default(\"PENDING\") // PENDING, SENT, FAILED, CANCELLED\n  sentAt        DateTime?\n  sentCount     Int? // how many messages sent\n  errorMessage  String?   @db.Text\n  createdAt     DateTime  @default(now())\n  updatedAt     DateTime  @updatedAt\n\n  @@index([sessionId])\n  @@index([status])\n  @@index([scheduledAt])\n}\n",
